// src/components/Education.jsx
const Education = () => (
    <section id="education">
      <h2 className="center">Education</h2>
      <div className="card">
        <h3>Bachelor of Science</h3>
        <p><strong>Institution:</strong> The Ohio State University</p>
        <p><strong>Duration:</strong> 2023 - 2027</p>
        <p><strong>Double Major:</strong> Computer Science and Engineering and Mathematics</p>
        <p><strong>GPA:</strong> 3.77</p>
        <p><strong>Key Courses:</strong> Software Components, Discrete Mathematics, Data Structures and Algorithms, Linear Algebra</p>
      </div>
    </section>
  );

  export default Education;
